  const getCategoryName = (id: any): any => {
    const categoryName = categories.find((c) => {
      return c._id === id;
    });
    console.log(categoryName?.name);
    
    return categoryName;
  };

  const productCategoryName = getCategoryName(product.category)

  return (
    <tbody>
      <tr>
        <td>{product._id}</td>
        <td>{product.name}</td>
        <td>{}</td>
        <td>{product.price}</td>
        <td>{product.amount}</td>
        <td>{product.image}</td>
      </tr>
    </tbody>
  );
};
